{'passage': 'Ducks have many economic uses, being farmed for their meat, eggs, feathers, (particularly their down). They are also kept and bred by aviculturists and often displayed in zoos. All domestic ducks are descended from the wild Mallard Anas platyrhynchos, except the Muscovy Duck', 'id': 3181}
---
{'passage': 'A worldwide group like the ducks has many predators. Ducklings are particularly vulnerable, since their inability to fly makes them easy prey not only for avian hunters but also large fish like pike, crocodilians,  and other aquatic hunters, including fish-eating birds such as herons. Nests may also be raided by land-based predators, and brooding females may sometimes be caught unaware on the nest by mammals (e.g. foxes) and large birds, including hawks and eagles.', 'id': 3175}
---
{'passage': 'Diving ducks and sea ducks forage deep underwater. To be able to submerge more easily, the diving ducks are heavier than dabbling ducks, and therefore have more difficulty taking off to fly.', 'id': 3168}

{'passage': 'Kangaroos are the only large animals to use hopping as a means of locomotion. The comfortable hopping speed for Red Kangaroo is about 20 25 km/h (13 16 mph), but speeds of up to 70 km/h (44 mph) can be attained, over short distances, while it can sustain a speed of 40 km/h (25 mph) for  nearly two kilometres.    This fast and energy-efficient method of travel has evolved because of the need to regularly cover large distances in search of food and water, rather than the need to escape predators.', 'id': 1738}
---
{'passage': 'There is also a link between the hopping action and breathing: as the feet leave the ground, air is expelled from the lungs; bringing the feet forward ready for landing refills the lungs, providing further energy efficiency. Studies of kangaroos and wallabies have demonstrated that, beyond the minimum energy expenditure required to hop at all, increased speed requires very little extra effort (much less than the same speed increase in, say, a horse, dog or human), and that the extra energy is required to carry extra weight. For kangaroos, the key benefit of hopping is not speed to escape predators the top speed of a kangaroo is no higher than that of a similarly-sized quadruped, and the Australian native predators are in any case less fearsome than those of other continents but economy: in an infertile continent with highly variable weather patterns, the ability of a kangaroo to travel long distances at moderately high speed in search of food sources is crucial to survival.', 'id': 1752}
---
{'passage': 'Along with dingos and other canids, introduced species like foxes and feral cats also pose a threat to kangaroo populations. Kangaroos and wallabies are adept swimmers, and often flee into waterways if presented with the option. If pursued into the water, a large kangaroo may use its forepaws to hold the predator underwater so as to drown it.  Canadian Museum of Nature - Kangaroo URL accessed January 6, 2007.  Another defensive tactic described by witnesses is catching the attacking dog  with the forepaws and disembowelling it with the hind legs.', 'id': 1746}
---
{'passage': 'Kangaroos have large, powerful hind legs, large feet adapted for leaping, a long muscular tail for balance, and a small head. Like all marsupials, female kangaroos have a pouch called a marsupium in which joeys complete postnatal development.', 'id': 1737}
---
{'passage': 'Hindleg of a kangaroo Kangaroos and wallabies have large, stretchy  tendons in their hind legs. They store elastic strain energy in the tendons of their large hind legs, providing most of the energy required for each hop by the spring action of the tendons rather than by any muscular effort. This is true in all animal species which have muscles connected to their skeleton through elastic elements such as tendons, but the effect is more pronounced in kangaroos.', 'id': 1751}

{'passage': 'Non-official languages are important in Canada, with 5,202,245 people listing one as a first language.  Some significant non-official first languages include Chinese (853,745 first-language speakers), Italian (469,485), German (438,080), and Punjabi (271,220).', 'id': 2361}
---
{'passage': "Canada's two official languages are  English and French. Official Bilingualism in Canada is law, defined in the Canadian Charter of Rights and Freedoms, the Official Languages Act, and Official Language Regulations; it is applied by the Commissioner of Official Languages. English and French have equal status in federal courts, Parliament, and in all federal institutions. The public has the right, where there is sufficient demand, to receive federal government services in either English or French, and official language minorities are guaranteed their own schools in all provinces and territories.", 'id': 2358}
---
{'passage': 'A federation now comprising ten provinces and three territories, Canada is a parliamentary democracy and a constitutional monarchy with Queen Elizabeth II as its head of state. It is a bilingual and multicultural country, with both English and French as official languages at the federal level. Technologically advanced and industrialized, Canada maintains a diversified economy that is heavily reliant upon its abundant natural resources and upon tradeâ\x80\x94particularly with the United States, with which Canada has had a long and complex relationship.', 'id': 2274}
---
{'passage': 'English and French are the mother tongues of 59.7% and 23.2% of the population respectively,    and the languages most spoken at home by 68.3% and 22.3% of the population respectively.    98.5% of Canadians speak English or French (English only: 67.5%, French only: 13.3%, both: 17.7%).    English and French Official Language Communities, defined by First Official Language Spoken, constitute 73.0% and 23.6% of the population.', 'id': 2359}
---
{'passage': "Although 85% of French-speaking Canadians live in Quebec, there are substantial Francophone populations in Ontario, Alberta and southern Manitoba, with an Acadian population in the northern and southeastern parts of New Brunswick constituting 35% of that province's population as well as concentrations in Southwestern Nova Scotia and on Cape Breton Island. Ontario has the largest French-speaking population outside Quebec. The Charter of the French Language in Quebec makes French the official language in Quebec, and New Brunswick is the only province to have a statement of official bilingualism in the constitution.    Other provinces   have no official language(s) as such, but French is used as a language of instruction, in courts, and other government services in addition to English. Manitoba, Ontario and Quebec allow for both English and French to be spoken in the provincial legislatures, and laws are enacted in both languages. In Ontario, French has some legal status but is not fully co-official. Several aboriginal languages have official status in Northwest Territories. Inuktitut is the majority language in Nunavut, and one of three official languages in the territory.", 'id': 2360}

{'passage': "A civilian at age 32, Grant struggled through seven lean years. From 1854 to 1858 he labored on a family farm near St. Louis, Missouri, using slaves owned by his father-in-law, but it did not prosper. Grant owned one slave (whom he set free in 1859); his wife owned four slaves (two women servants and their two small boys). His wife's slaves were leased in St. Louis in 1860 after Grant gave up farming. The land and cabin where Grant lived is now an animal conservation reserve, Grant's Farm, owned and operated by the Anheuser-Busch Company.  In 1858-59 he was a bill collector in St. Louis. Failing at everything, in humiliation he asked his father for a job, and in 1860 was made an assistant in the leather shop owned by his father and run by his younger brother in Galena, Illinois. Grant & Perkins sold harnesses, saddles, and other leather goods and purchased hides from farmers in the prosperous Galena area. McFeely, ch. 5.", 'id': 1779}
---
{'passage': 'On August 22, 1848, Grant married Julia Boggs Dent (1826 1902), the daughter of a slave owner. They had four children: Frederick Dent Grant, Ulysses S. Grant, Jr. (Buck), Ellen Wrenshall Grant (Nellie), and Jesse Root Grant.', 'id': 1775}
---
{'passage': 'Grant was born in a log cabin in Point Pleasant, Clermont County, Ohio, 25 miles (40 km) east of Cincinnati on the Ohio River. He was the eldest of the six children of Jesse Root Grant (1794 1873) and Hannah Simpson Grant (1798 1883). His father, a tanner, was from Pennsylvania, and his mother was born in Horsham Township, Pennsylvania. In the fall of 1823, they moved to the village of Georgetown in Brown County, Ohio.', 'id': 1774}
---
{'passage': '* McFeely, William S., Grant: A Biography, W. W. Norton & Co, 1981, ISBN 0-393-01372-3.', 'id': 1882}
---
{'passage': 'The second president from Ohio, Grant was the 18th President of the United States and served two terms from March 4, 1869, to March 4, 1877. In the 1872 election he won by a landslide against the breakaway Liberal Republican party that nominated Horace Greeley.', 'id': 1813}

{'passage': 'Kangaroos have large, powerful hind legs, large feet adapted for leaping, a long muscular tail for balance, and a small head. Like all marsupials, female kangaroos have a pouch called a marsupium in which joeys complete postnatal development.', 'id': 1737}
---
{'passage': 'Kangaroos have developed a number of adaptations to a dry, infertile continent and highly variable climate. As with all marsupials, the young are born at a very early stage of development   after a gestation of 31 36 days. At this stage, only the forelimbs are somewhat developed, to allow the newborn to climb to the pouch and attach to a teat. In comparison, a human embryo at a similar stage of development would be about seven weeks old, and premature babies born at less than 23 weeks are usually not mature enough to survive. The joey will usually stay in the pouch for about nine months (180 320 days for the Western Grey) before starting to leave the pouch for small periods of time. It is usually fed by its mother until reaching 18 months.', 'id': 1748}
---
{'passage': 'The female kangaroo is usually pregnant in permanence, except on the day she gives birth; however, she has the ability to freeze the development of an embryo until the previous joey is able to leave the pouch. This is known as diapause, and will occur in times of drought and in areas with poor food sources.  The composition of the milk produced by the mother varies according to the needs of the joey. In addition, the mother is able to produce two different kinds of milk simultaneously for the newborn and the older joey still in the pouch.', 'id': 1749}
---
{'passage': 'Occasionally, individuals take on the task of rearing a recovered joey themselves. The rule-of-thumb says that if the joey is already covered with fur at the time of the accident (as opposed to still being in its embryonic stage), it stands a good chance of growing up properly. Lactose-free milk is required, otherwise the animal may develop blindness. They hop readily into a cloth bag when it is lowered in front of them approximately to the height where the mother\'s pouch would be. The joey\'s instinct is to "cuddle up", thereby endearing themselves to their keepers, but after hand-rearing a joey, it cannot usually be released into the wild and be expected to provide for itself immediately. Usually wildlife sanctuaries are willing to adopt kangaroos which are no longer practical, or have grown too large to contain, needing at least 1 acre and 7ft boundary fences for a fully grown kangaroo.', 'id': 1765}
---
{'passage': 'Newborn joey sucking on a teat in the pouch', 'id': 1747}

{'passage': 'Penguins either waddle on their feet or slide on their bellies across the snow, a movement called "tobogganing", which conserves energy while moving quickly.  They also jump with both feet together if they want to move more quickly or cross steep or rocky terrain.', 'id': 961}
---
{'passage': "Penguins are popular around the world, primarily for their unusually upright, waddling pace and (compared to other birds) lack of fear of humans. Their striking black and white plumage is often likened to a tuxedo suit. Perhaps in reaction to this cutesy stereotype, fictional penguins are occasionally presented as grouchy or even sinister. Penguins have also been the subject of many books and documentary films such as Happy Feet and Surf's Up, both CGI-Animated Animal Adventure Films, March of the Penguins, a documentary based on the migration process of Emperors, and a parody film entitled Farce of the Penguins. Mistakenly, some artists and writers have penguins based in the North Pole.  This is incorrect as there are almost no wild penguins in the northern hemisphere, and those only barely (northernmost of the GalÃ¡pagos). Penguins have also found their way into a number of cartoons and television dramas, perhaps the most notable of these is Pingu - created by Silvio Mazzola in 1986 and covering more than 100 short episodes.", 'id': 1000}
---
{'passage': 'Penguins have a thick layer of insulating feathers which are designed to keep them warm in water (heat loss in water is much greater than in air).  The Emperor penguin (the largest penguin) has the largest body mass of all penguins, which further reduces relative surface area and heat loss. They also are able to control blood flow to their extremities, reducing the amount of blood which gets cold, but still keeping the extremities from freezing.  In the extreme cold of the Antarctic winter, the females are at sea fishing for food leaving the males to brave the weather by themselves.  They often huddle together to keep warm and rotate positions to make sure that each penguin gets a turn in the center of the heat pack.', 'id': 963}
---
{'passage': 'The word Penguin is thought by some to derive from the Welsh words pen (head) and gwyn (white),  Oxford English Dictionary. Accessed March 21, 2007.  applied to the Great Auk, which had white spots in front of its eyes (although its head was black), or from an island off Newfoundland known as Pengwyn, due to a large white rock. (In the latter case, the name may also have come from Breton.) This theory is supported by the fact that penguins look remarkably like Great Auks in general shape.', 'id': 996}
---
{'passage': 'What seems clear is that penguins belong to a clade of Neoaves (living birds except paleognaths and fowl) which comprises what is sometimes called "higher waterbirds" to distinguish them from the more ancient waterfowl. This group contains such birds as storks, rails, and the seabirds, with the possible exception of the Charadriiformes (Fain & Houde 2004).', 'id': 993}

{'passage': "Finland currently numbers 5,290,158 inhabitants and has an average population density of 17 inhabitants per square kilometre.  This makes it, after Norway and Iceland, the most sparsely populated country in Europe. Finland's population has always been concentrated in the southern parts of the country, which is even more pronounced after twentieth-century urbanisation. The biggest and most important cities in Finland are the cities of the Greater Helsinki metropolitan area - Helsinki, Vantaa, Espoo and Kauniainen - some of the other big cities include Tampere, Turku and Oulu.", 'id': 1609}
---
{'passage': 'Finland is a country of thousands of lakes and islands; 187,888 lakes (larger than 500 mÂ²) and 179,584 islands to be precise.    One of these lakes, Saimaa, is the fifth largest in Europe. The Finnish landscape is mostly flat with few hills and its highest point, the Halti at 1,324 metres, is found in the extreme north of Lapland at the border between Finland and Norway.', 'id': 1580}
---
{'passage': 'Finland has a population of 5,300,362 people,  spread over an area of  . The majority of the population is concentrated in the southern part of the country. Finland is the sixth largest country in Europe in terms of area, with a low population density of 15.5 people per square kilometre, making it the most sparsely populated country in the European Union.  As their mother tongue, most Finns speak Finnish, one of the few official languages of the European Union that is not of Indo-European origin. The second official language, Swedish, is spoken natively by a 5.5 percent minority.', 'id': 1551}
---
{'passage': "Finland's transport network is developed. As of 2005, the country's network of main roads has a total length of 13,258 km, and is mainly centred on the capital city of Helsinki. The total length of all public roads is 78,186 km, of which 50,616 km are paved. The motorway network is still to a great extent under development, and currently totals 653 km. There are 5,865 km of railways in the country. Helsinki has an urban rail network, and light rail systems are currently being planned in Turku and Tampere. Finland also has a considerable number of airports and large ports.", 'id': 1664}
---
{'passage': 'Finland, officially the Republic of Finland "Republic of Finland", or "Suomen tasavalta" in Finnish and "Republiken Finland" in Swedish, is the long protocol name, which is not defined by the law. Legislation only recognizes the short name.  ( ), is a Nordic country situated in Northern Europe. It has borders with Sweden to the west, Russia to the east, and Norway to the north, while Estonia lies to its south across the Gulf of Finland. The capital city is Helsinki.', 'id': 1550}

{'passage': 'Thomas Woodrow Wilson (December 28, 1856â\x80\x93February 3, 1924), was the twenty-eighth President of the United States. A devout Presbyterian and leading "intellectual" of the Progressive Era, he served as president of Princeton University then became the reform governor of New Jersey in 1910. With Theodore Roosevelt and William Howard Taft dividing the Republican vote, Wilson was elected President as a Democrat in 1912. He proved highly successful in leading a Democratic Congress to pass major legislation including the Federal Trade Commission, the Clayton Antitrust Act, the Underwood Tariff, the Federal Farm Loan Act and most notably the Federal Reserve System.', 'id': 2129}
---
{'passage': 'In 1879, Wilson attended law school at University of Virginia for one year but he never graduated. His frail health dictated withdrawal, and he went home to Wilmington, North Carolina where he continued his studies. Wilson was also a member of the Phi Kappa Psi fraternity. In 1885, he married Ellen Louise Axson, the daughter of a minister from Rome, Georgia.', 'id': 2133}
---
{'passage': "Wilsonâ\x80\x99s mother was probably a hypochondriac and Wilson seemed to think that he was often in poorer health than he really was.  However, he did suffer from hyper-tension at a relatively early age and may have suffered his first stroke at age 39.  He cycled regularly, including several cycling vacations in the Lake District in Britain.  Unable to cycle around Washington, D.C. as President, Wilson took to playing golf, although he played with more enthusiasm than skill.  During the winter the Secret Service would paint some golf balls black so Wilson could hit them around in the snow on the White House lawn.  for details on Wilson's health see Edwin A. Weinstein, Woodrow Wilson: A Medical and Psychological Biography (Princeton 1981)", 'id': 2134}
---
{'passage': "Thomas Woodrow Wilson was born in Staunton, Virginia in 1856 as the third of four children to Reverend Dr. Joseph Wilson (1822â\x80\x931903) and Janet Woodrow (1826â\x80\x931888). His ancestry was Scots-Irish and Scottish. His paternal grandparents immigrated to the United States from Strabane, County Tyrone, Ireland, while his mother was born in London to Scottish parents. Wilson's father was originally from Steubenville, Ohio where his grandfather had been an abolitionist newspaper publisher and his uncles were Republicans. But his parents moved South in 1851 and identified with the Confederacy. His father defended slavery, owned slaves and set up a Sunday school for them. They cared for wounded soldiers at their church. The father also briefly served as a chaplain to the Confederate army. Wilsonâ\x80\x99s father was one of the founders of the Southern Presbyterian Church in the United States (PCUS) after it split from the northern Presbyterians in 1861. Joseph R. Wilson served as the first permanent clerk of the southern churchâ\x80\x99s General Assembly, was Stated Clerk from 1865-1898 and was Moderator of the PCUS General Assembly in 1879. Wilson spent the majority of his childhood, up to age 14, in Augusta, Georgia, where his father was minister of the First Presbyterian Church. Wilson did not learn to read until he was about 12 years old. His difficulty reading may have indicated dyslexia or A.D.D., but as a teenager he taught himself shorthand to compensate and was able to achieve academically through determination and self-discipline.  He studied at home under his father's guidance and took classes in a small school in Augusta. Link Road to the White House pp. 3-4.  During Reconstruction he lived in Columbia, South Carolina, the state capital, from 1870-1874, where his father was professor at the Columbia Theological Seminary.  Walworth ch 1  In 1873 he spent a year at Davidson College in North Carolina, then transferred to Princeton as a freshman, graduating in 1879. Beginning in his second year, he read widely in political philosophy and history. He was active in the undergraduate discussion club, and organized a separate Liberal Debating Society.  Link, Wilson I:5-6; Wilson Papers I: 130, 245, 314", 'id': 2132}
---
{'passage': "In 1921, Wilson and his wife retired from the White House to a home in the Embassy Row section of Washington, D.C.  Wilson continued going for daily drives and attended Keith's vaudeville theater on Saturday nights.", 'id': 2223}

{'passage': "The leopard (Panthera pardus) is an Old World mammal of the Felidae family and the smallest of the four 'big cats' of the genus Panthera, along with the tiger, lion, and jaguar. Leopards that are melanistic, either all-black or very dark in coloration, are known colloquially as Black Panthers.", 'id': 2445}
---
{'passage': 'Most other colour morphs of leopards are known only from paintings or museum specimens. There have been very rare examples where the spots of a normal black leopard have coalesced to give a jet black leopard with no visible markings. Pseudo-melanism (abundism) occurs in leopards. The spots are more densely packed than normal and merge to largely obscure the background colour. They may form swirls and, in some places, solid black areas. Unlike a true black leopard the tawny background colour is visible in places. One pseudo-melanistic leopard had a tawny orange coat with coalescing rosettes and spots, but white belly with normal black spots (like a black-and-tan dog).', 'id': 2479}
---
{'passage': 'A melanistic morph of the leopard occurs particularly in mountainous areas and rain forests. The black color is heritable and caused by only one recessive gene locus. In some regions, for example on the Malayan Peninsula, up to half of all leopards are black. In Africa black leopards seem to be most common in the Ethiopian Highlands. While they are commonly called black panthers, the term is not applied exclusively to leopards. Black leopards are less successful on the African plains because their colouration makes them stand out.', 'id': 2456}
---
{'passage': "Traditionally, the leopard is an uncommon name or mascot for sporting teams, though it has been used in several African soccer teams: the AFC Leopards, formed in 1964, are a soccer club based in Nairobi, Kenya, while the Black Leopards play in South Africa's Premier Soccer League, the Royal Leopards in Swaziland's Premier League, and the Golf Leopards in the Sierra Leone National Premier League. More recently, the leopard emblem has been a part of the English Basketball League since the 1990s with the Essex Leopards and later London Leopards. The New Zealand Rugby League has featured the Otahuhu Leopards and then the Tamaki Leopards.", 'id': 2500}
---
{'passage': 'A pseudo-melanistic leopard has a normal background colour, but its excessive markings have coalesced so that its back seems to be an unbroken expanse of black. In some specimens, the area of solid black extends down the flanks and limbs; only a few lateral streaks of golden-brown indicate the presence of normal background colour. Any spots on the flanks and limbs that have not merged into the mass of swirls and stripes are unusually small and discrete, rather than forming rosettes. The face and underparts are paler and dappled like those of ordinary spotted leopards.', 'id': 2477}

{'passage': 'The Principality of Liechtenstein (  ( , ( ) is a tiny, doubly landlocked alpine country in Western Europe, bordered by Switzerland to its west and by Austria to its east. Mountainous, it is a winter sports resort, although it is perhaps best known as a tax haven. Despite this, it is not heavily urbanized. Many cultivated fields and small farms characterize its landscape both in the north (Unterland) and in the south (Oberland). It is the smallest German-speaking country in the world.', 'id': 2817}
---
{'passage': "Liechtenstein is the fourth smallest country of Europe, after the Vatican City, Monaco, and San Marino. Its population is primarily ethnic Alemannic, although its resident population is approximately one third foreign-born, primarily German speakers from the Federal Republic of Germany, Austria, and the Swiss Confederation, other Swiss, Italians, and Turks. Foreign-born people make up two-thirds of the country's workforce. Nationals are referred to by the plural: Liechtensteiners.", 'id': 2856}
---
{'passage': "Liechtenstein participates in a customs union with Switzerland and employs the Swiss franc as national currency. The country imports more than 90% of its energy requirements. Liechtenstein has been a member of the European Economic Area (an organization serving as a bridge between the European Free Trade Association (EFTA) and the European Union) since May 1995 . The government is working to harmonize its economic policies with those of an integrated Europe. Since 2002, Liechtenstein's rate of unemployment has doubled, although it stood at only 2.2% in the third quarter of 2004. Currently, there is only one hospital in Liechtenstein, the Liechtensteinisches Landesspital in Vaduz. The GDP (PPP) is $1.786 billion CIA World Factbook ( link)  and $25,000 per person.", 'id': 2852}
---
{'passage': 'As a result of its small size Liechtenstein has been strongly affected by external cultural influences, most notably those originating in the southern German-speaking areas of Europe, including Austria, Bavaria, Switzerland, and Tyrol. The Historical Society of the Principality of Liechtenstein plays a role in preserving the culture and history of the country.', 'id': 2864}
---
{'passage': 'Liechtenstein is one of only two doubly landlocked countries in the worldâ\x80\x94being a landlocked country wholly surrounded by other landlocked countriesâ\x80\x94the other is Uzbekistan. It is the only country with a predominantly German-speaking population that does not share a border with the Federal Republic of Germany.', 'id': 2846}

