{'passage': 'Since 1995, Emir Hamad bin Khalifa Al Thani has ruled Qatar, seizing control of the country from his father Khalifa bin Hamad Al Thani while the latter vacationed in Switzerland. Under Emir Hamad, Qatar has experienced a notable amount of sociopolitical liberalization, including the enfranchisement of women, a new constitution, and the launch of Al Jazeera, a leading English and Arabic news source, which operates a website and satellite television news channel. Qatar ranks as the ninth richest country in the world per capita .', 'id': 2548}
