{'passage': "The justice system is independent of the other branches of government, and is made up of a hierarchical system of courts culminating in the High Court of Cassation and Justice, which is the supreme court of Romania.  High Court of Cassation and Justice - Presentation  There are also courts of appeal, county courts and local courts. The Romanian judicial system is strongly influenced by the French model,  CIA Factbook 2000 - Legal system  considering that it is based on civil law and is inquisitorial in nature. The Constitutional Court (Curtea ConstituÅ£ionalÄ\x83) is responsible for judging the compliance of laws and other state regulations to the Romanian Constitution, which is the fundamental law of the country. The constitution, which was introduced in 1991, can only be amended by a public referendum; the last amendment was in 2003. The Romanian Constitutional Court structure is based on the Constitutional Council of France, being made up of nine judges who serve nine-year, non-renewable terms.  Following the 2003 constitutional amendment, the court's decisions cannot be overruled by any majority of the parliament.", 'id': 3143}

{'passage': 'Although Grant was essentially apolitical, his father-in-law was a prominent Democrat in St. Louis (a fact that lost Grant the good job of county engineer in 1859). In 1856 he voted for Democrat James Buchanan for president to avert secession and because "I knew FrÃ©mont" (the Republican candidate). In 1860, he favored Democrat Stephen A. Douglas but did not vote. In 1864, he allowed his political sponsor, Congressman Elihu B. Washburne, to use his private letters as campaign literature for Abraham Lincoln  The Abraham Lincoln Papers at the Library of Congress. Retrieved April 28, 2007.  and the Union Party, which combined both Republicans and War Democrats. He refused to announce his political affiliation until 1868, when he finally declared himself a Republican. Hesseltine, chapter 6. .', 'id': 1780}
