{'passage': "Applying for sea duty, Ford was sent in May 1943 to the pre-commissioning detachment for the new aircraft carrier USS Monterey, at New York Shipbuilding Corporation, Camden, New Jersey. From the ship's commissioning on June 17, 1943 until the end of December 1944, Ford served as the assistant navigator, Athletic Officer, and antiaircraft battery officer on board the Monterey. While he was on board, the carrier participated in many actions in the Pacific Theater with the Third and Fifth Fleets during the fall of 1943 and in 1944. In 1943, the carrier helped secure Makin Island in the Gilberts, and participated in carrier strikes against Kavieng, New Ireland in 1943. During the spring of 1944, the Monterey supported landings at Kwajalein and Eniwetok and participated in carrier strikes in the Marianas, Western Carolines, and northern New Guinea, as well as in the Battle of the Philippine Sea.         After overhaul, from September to November 1944, aircraft from the Monterey launched strikes against Wake Island, participated in strikes in the Philippines and Ryukyus, and supported the landings at Leyte and Mindoro.", 'id': 2013}

{'passage': 'Roosevelt was a Republican activist during his years in the Assembly, writing more bills than any other New York state legislator. Already a major player in state politics, he attended the Republican National Convention in 1884 and fought alongside the Mugwump reformers; they lost to the Stalwart faction that nominated James G. Blaine. Refusing to join other Mugwumps in supporting Democrat Grover Cleveland, the Democratic nominee, he stayed loyal.', 'id': 2893}
---
{'passage': "Late in 1911, Roosevelt finally broke with Taft and LaFollette and announced himself as a candidate for the Republican nomination. But Roosevelt had delayed too long, and Taft had already won the support of most party leaders in the country. Because of LaFollette's nervous breakdown on the campaign trail before Roosevelt's entry, most of LaFollette's supporters went over to Roosevelt, the new progressive Republican candidate.", 'id': 2984}
---
{'passage': "Theodore Roosevelt was the fifth Vice President to succeed to the office of President, but the first to win election in his own right.  (Millard Fillmore ran and lost on a third-party ticket four years after leaving office and Chester Arthur was denied nomination by his party in 1884).  After Senator Mark Hanna, McKinley's old campaign manager, died in February 1904, there was no one in the Republican Party to oppose Roosevelt and he easily won the nomination.  When an effort to draft former president Grover Cleveland failed, the Democrats were without a candidate and finally settled on obscure New York judge Alton B. Parker.  The outcome was never in doubt.  Roosevelt crushed Parker 56%-38% in the popular vote and 336-140 in the Electoral College, sweeping the country outside the perennially Democratic Solid South.  Socialist Eugene Debs got 3%.  The night of the election, after his victory was clear, Roosevelt promised not to run again in 1908.  He later regretted that promise, as it compelled him to leave the White House at the age of only fifty, at the height of his popularity.", 'id': 2932}
---
{'passage': 'At the Republican Convention in Chicago, despite being the incumbent, Taft\'s victory was not immediately assured.  But after two weeks, Roosevelt, realizing he would not be able to win the nomination outright, asked his followers to leave the convention hall.  They moved to the Auditorium Theatre, and then Roosevelt, along with key allies such as Pinchot and Albert Beveridge created the Progressive Party, structuring it as a permanent organization that would field complete tickets at the presidential and state level. It was popularly known as the "Bull Moose Party," which got its name after Roosevelt told reporters, "I\'m as fit as a bull moose." Carl M. Cannon, The Pursuit of Happiness in Times of War, Rowman & Littlefield: 2003, p. 142. ISBN 0742525929.  At the convention Roosevelt cried out, "We stand at Armageddon and we battle for the Lord." Roosevelt\'s platform echoed his 1907â\x80\x9308 proposals, calling for vigorous government intervention to protect the people from the selfish interests. Thayer, Chapter XXII, pp. 25 31.', 'id': 2986}
---
{'passage': 'On leaving the Army, Roosevelt re-entered New York state politics and was elected governor of New York in 1898 on the Republican ticket. He made such a concerted effort to root out corruption and "machine politics" Republican boss Thomas Collier Platt forced him on McKinley as a running mate in the 1900 election, against the wishes of McKinley\'s manager Senator Mark Hanna.  Roosevelt was a powerful campaign asset for the Republican ticket, which defeated William Jennings Bryan in a landslide based on restoration of prosperity at home and a successful war and new prestige abroad. Bryan stumped for Free Silver again, but McKinley\'s  promise of prosperity through the Gold Standard, high tariffs, and the restoration of business confidence enlarged his margin of victory.  Bryan had strongly supported the war against Spain, but denounced the annexation of the Philippines as imperialism that would spoil America\'s innocence.  Roosevelt countered with many speeches that argued it was best for the Filipinos to have stability, and the Americans to have a proud place in the world.  Roosevelt\'s six months as Vice President (March to September, 1901) were uneventful. Brands ch 14â\x80\x9315  On September 2, 1901, at the Minnesota State Fair, Roosevelt first used in a public speech a saying that would later be universally associated with him: "Speak softly and carry a big stick, and you will go far."', 'id': 2923}

