{'passage': "Gerald R. Ford was born Leslie Lynch King, Jr. on July 14, 1913, at 12:43 a.m. CST, at 3202 Woolworth Avenue in Omaha, Nebraska. His parents, Leslie Lynch King, Sr., a wool trader whose father was a prominent banker, and his wife, the former Dorothy Ayer Gardner, separated just sixteen days after his birth. His mother took him to the Oak Park, Illinois home of her sister Tannisse and her husband, Clarence Haskins James. From there she moved to the home of her parents, Levi Addison Gardner and his wife, the former Adele Augusta Ayer, in Grand Rapids, Michigan. Ford's parents divorced the following December with his mother gaining full custody.", 'id': 1995}
