{'passage': "Ford remained relatively active in the years after his presidency and continued to make appearances at events of historical and ceremonial significance to the nation, such as presidential inaugurals and memorial services. In 1977, he reluctantly agreed to be interviewed by James M. Naughton, a New York Times journalist who was given the assignment to write the former President's advance obituary, an article that would be updated prior to its eventual publication.", 'id': 2084}

