{'passage': "In 2001, a global recession and slump in the technology sector caused the GDP to contract by 2.2 percent. The Economic Review Committee (ERC), set up in December 2001, recommended several policy changes with a view to revitalising the economy. Singapore has since recovered from the recession, largely due to improvements in the world economy; the Singaporean economy itself grew by 8.3 percent in 2004, 6.4 percent in 2005    and 7.9 percent in 2006.    In the first half of Year 2007, the economy grew by 7.6 percent. The growth forecast for the whole year is expected to be between 7 percent to 8 percent, up from the original estimation of 5 percent to 7 percent.     On August 19 2007, Prime Minister Lee Hsien Loong announced in his National Day Rally Speech that Singapore's economy is expected to grow by at least 4-6 percent annually over the next 5-10 years.", 'id': 2739}

{'passage': "Indonesia's size, tropical climate, and archipelagic geography, support the world's second highest level of biodiversity (after Brazil),    and its flora and fauna is a mixture of Asian and Australasian species.    Once linked to the Asian mainland, the islands of the Sunda Shelf (Sumatra, Borneo, Java, Borneo, and Bali) have a wealth of Asian fauna. Large species such as the tiger, rhinoceros, orangutan, elephant, and leopard, were once abundant as far east as Bali, but numbers and distribution have dwindled drastically.", 'id': 802}
---
{'passage': "Indonesia's 80,000 kilometers (50,000 mi) of coastline are surrounded by tropical seas that contribute to the country's high level of biodiversity. Indonesia has a range of sea and coastal ecosystems, including beaches, sand dunes, estuaries, mangroves, coral reefs, sea grass beds, coastal mudflats, tidal flats, algal beds, and small island ecosystems.", 'id': 804}
---
{'passage': 'Across its many islands, Indonesia consists of distinct ethnic, linguistic, and religious groups. The Javanese are the largest and politically dominant ethnic group. As a unitary state and a nation, Indonesia has developed a shared identity defined by a national language, a majority Muslim population, and a history of colonialism and rebellion against it. Indonesia\'s national motto, "Bhinneka tunggal ika" ("Unity in Diversity" lit. "many, yet one"), articulates the diversity that shapes the country. However, sectarian tensions and separatism have led to violent confrontations that have undermined political and economic stability. Despite its large population and densely populated regions, Indonesia has vast areas of wilderness that support the world\'s second highest level of biodiversity. The country is richly endowed with natural resources, yet poverty is a defining feature of contemporary Indonesia.', 'id': 753}
---
{'passage': "Indonesia's high population and rapid industrialization present serious environmental issues, which are often given a lower priority due to high poverty levels and weak, under-resourced governance.    Issues include large-scale deforestation (much of it illegal) and related wildfires causing heavy smog over parts of western Indonesia, Malaysia and Singapore; over-exploitation of marine resources; and environmental problems associated with rapid urbanization and economic development, including air pollution, traffic congestion, garbage management, and reliable water and waste water services.  Habitat destruction threatens the survival of indigenous and endemic species, including 140 species of mammals identified by the World Conservation Union (IUCN) as threatened, and 15 identified as critically endangered, including the Sumatran Orangutan.", 'id': 806}
---
{'passage': "At 1,919,440 square kilometers (741,050 sq mi), Indonesia is the world's 16th-largest country in terms of land area.    Its average population density is 134 people per square kilometer (347 per sq mi), 79th in the world,    although Java, the world's most populous island,    has a population density of 940 people per square kilometer (2,435 per sq mi). At 4,884 meters (16,024 ft), Puncak Jaya in Papua is Indonesia's highest peak, and Lake Toba in Sumatra its largest lake, with an area of 1,145 square kilometers (442 sq mi). The country's largest rivers are in Kalimantan, and include the Mahakam and Barito; such rivers are communication and transport links between the island's river settlements.", 'id': 797}

