{'passage': "Indonesia has around 300 ethnic groups, each with cultural differences developed over centuries, and influenced by Arabic, Chinese, Malay, and European sources. Traditional Javanese and Balinese dances, for example, contain aspects of Hindu culture and mythology, as do wayang kulit (shadow puppet) performances. Textiles such as batik, ikat and songket are created across Indonesia in styles that vary by region. The most dominant influences on Indonesian architecture have traditionally been Indian; however, Chinese, Arab, and European architectural influences have been significant. The most popular sports in Indonesia are badminton and football; Liga Indonesia is the country's premier football club league. Traditional sports include sepak takraw, and bull racing in Madura. In areas with a history of tribal warfare, mock fighting contests are held, such as, caci in Flores, and pasola in Sumba. Pencak Silat is an Indonesian martial art. Sports in Indonesia are generally male-orientated and spectator sports are often associated with illegal gambling.", 'id': 822}
---
{'passage': "The oldest evidence of writing in Indonesia is a series of Sanskrit inscriptions dated to the 5th century CE. Important figures in modern Indonesian literature include: Dutch author Multatuli, who criticized treatment of the Indonesians under Dutch colonial rule; Sumatrans Muhammad Yamin and Hamka, who were influential pre-independence nationalist writers and politicians; Taylor (2003), pages 299â\x80\x93301  and proletarian writer Pramoedya Ananta Toer, Indonesia's most famous novelist. Vickers (2005) pages 3 to 7; Friend (2003), pages 74, 180  Many of Indonesia's peoples have strongly-rooted oral traditions, which help to define and preserve their cultural identities.    Media freedom in Indonesia increased considerably after the end of President Suharto's rule, during which the now-defunct Ministry of Information monitored and controlled domestic media, and restricted foreign media.    The TV market includes ten national commercial networks, and provincial networks that compete with public TVRI. Private radio stations carry their own news bulletins and foreign broadcasters supply programs. At a reported 18 million users in 2005,    Internet usage is limited to a minority of the population.", 'id': 825}
---
{'passage': "Although religious freedom is stipulated in the Indonesian constitution,    the government officially recognizes only six religions: Islam; Protestantism; Roman Catholicism; Hinduism; Buddhism; and Confucianism.    Although it is not an Islamic state, Indonesia is the world's most populous Muslim-majority nation, with almost 86% of Indonesians declared Muslim according to the 2000 census.    11% of the population is Christian, of which roughly two-thirds are Protestant  2% are Hindu, and 1% Buddhist. Most Indonesian Hindus are Balinese,    and most Buddhists in modern-day Indonesia are ethnic Chinese.    Though now minority religions, Hinduism and Buddhism remain defining influences in Indonesian culture. Islam was first adopted by Indonesians in northern Sumatra in the 13th century, through the influence of traders, and became the country's dominant religion by the 16th century.    Roman Catholicism was brought to Indonesia by early Portuguese colonialists and missionaries, Ricklefs (1991), pp. 25, 26, 28 ;    and the Protestant denominations are largely a result of Dutch Calvinist and Lutheran missionary efforts during the country's colonial period. Ricklefs (1991), pp.28, 62; Vickers (2005), p.22;    A large proportion of Indonesians such as the Javanese abangan, Balinese Hindus, and Dayak Christians practice a less orthodox, syncretic form of their religion, which draws on local customs and beliefs. Magnis-Suseno, F. 1981, Javanese Ethics and World-View: The Javanese Idea of the Good Life, PT Gramedia Pustaka Utama, Jakarta, 1997, pp.15-18, ISBN 979-605-406-X;", 'id': 820}
---
{'passage': "Most Indonesians are descendant from Austronesian-speaking peoples, who originated from Taiwan. The other major grouping are Melanesians, who inhabit eastern Indonesia. Taylor (2003), pages 5â\x80\x937,  ;    There are around 300 distinct native ethnicities in Indonesia, and 742 different languages and dialects.  ;    The largest is the Javanese, who comprise 42% of the population, and are politically and culturally dominant.    The Sundanese, ethnic Malays, and Madurese are the largest non-Javanese groups. Small but significant populations of ethnic Chinese, Indians, Europeans and Arabs are concentrated mostly in urban areas.  A sense of Indonesian nationhood exists alongside strongly maintained regional identities. Ricklefs (1991), page 256  Society is largely harmonious, although social, religious and ethnic tensions have triggered horrendous violence.  Domestic migration (including the official Transmigrasi program) are a cause of violence such as the massacre of hundreds of Madurese by a local Dayak community in West Kalimantan, and conflicts in Maluku, Central Sulawesi, and parts of Papua and West Papua  ;  ;  ; Kyoto University: Sulawesi Kaken Team & Center for Southeast Asian Studies    Chinese Indonesians are an influential ethnic minority comprising less than 2% of the population. Much of the country's privately-owned commerce and wealth is Chinese-controlled, Schwarz (1994), pages 53, 80â\x80\x9381; Friend (2003), pages 85â\x80\x9387, 164â\x80\x93165, 233â\x80\x93237  which has contributed to considerable resentment, and even anti-Chinese violence.  ;   The riots in Jakarta in 1998 much of which were aimed at the Chinese were, in part, expressions of this resentment. ;", 'id': 817}
---
{'passage': "Indonesian cuisine varies by region and is based on Chinese, European, Middle Eastern, and Indian precedents.    Rice is the main staple food and is served with side dishes of meat and vegetables. Spices (notably chili), coconut milk, fish and chicken are fundamental ingredients. Compared to the infused flavors of Vietnamese and Thai food, flavors in Indonesia are kept relatively separate, simple and substantial.   Indonesian traditional music includes gamelan and keroncong. Dangdut is a popular contemporary genre of pop music that draws influence from Arabic, Indian, and Malay folk music. The Indonesian film industry's popularity peaked in the 1980s and dominated cinemas in Indonesia,    although it declined significantly in the early 1990s.      Between 2000 and 2005, the number of Indonesian films released each year has steadily increased.", 'id': 824}

{'passage': "Ford joined the Boy Scouts of America, and attained that program's highest rank, Eagle Scout. He always regarded this as one of his proudest accomplishments, even after attaining the White House.     In subsequent years, Ford received the Distinguished Eagle Scout Award in May 1970 and Silver Buffalo Award from the Boy Scouts of America. He is the only US president who was an Eagle Scout.    Scouting was so important to Ford that his family asked that Scouts participate in his funeral. About 400 Eagle Scouts were part of the funeral procession, where they formed an honor guard as the casket went by in front of the museum, and served as ushers.", 'id': 2001}
---
