{'passage': 'Despite his debilitating diseases, Roosevelt remained active to the end of his life. He was an enthusiastic proponent of the Scouting movement. The Boy Scouts of America gave him the title of Chief Scout Citizen, the only person to hold such title. One early Scout leader said, "The two things that gave Scouting great impetus and made it very popular were the uniform and Teddy Roosevelt\'s jingoism." Larson, Keith (2006).  "Theodore Roosevelt". Retrieved March 6 2006.', 'id': 3001}
---
{'passage': 'Ford was a member of several civic organizations, including the Benevolent and Protective Order of Elks, American Legion, Veterans of Foreign Wars, and AMVETS.Gerald R. Ford was initiated into Freemasonry on September 30, 1949.  The Supreme Council, Ancient and Accepted Scottish Rite, Southern Jurisdiction, USA.  He later said in 1975,  "When I took my obligation as a master mason â\x80\x94 incidentally, with my three younger brothers â\x80\x94 I recalled the value my own father attached to that order. But I had no idea that I would ever be added to the company of the Father of our Country and 12 other members of the order who also served as Presidents of the United States."', 'id': 2020}
