{'passage': "Millard Fillmore (January 7, 1800   March 8, 1874) was the thirteenth President of the United States, serving from 1850 until 1853, and the last member of the Whig Party to hold that office. He was the second Vice President to assume the Presidency upon the death of a sitting President, succeeding Zachary Taylor who died of acute gastroenteritis. Fillmore was never elected President; after serving out Taylor's term, he failed to gain the nomination for the Presidency of the Whigs in the 1852 presidential election, and, four years later, in the 1856 presidential election, he again failed to win election as President as the Know Nothing Party and Whig candidate.", 'id': 148}
---
{'passage': "He ran in the election of 1856 as the party's candidate, attempting to win a non-consecutive second term as President (a feat accomplished only once in American politics, by Grover Cleveland).  His running mate was Andrew Jackson Donelson, nephew of former president Andrew Jackson. Fillmore and Donelson finished third, carrying only the state of Maryland and its eight electoral votes; but he won 21.6% of the popular vote, one of the best showings ever by a Presidential third-party candidate.", 'id': 184}
---
{'passage': "Theodore Roosevelt was the fifth Vice President to succeed to the office of President, but the first to win election in his own right.  (Millard Fillmore ran and lost on a third-party ticket four years after leaving office and Chester Arthur was denied nomination by his party in 1884).  After Senator Mark Hanna, McKinley's old campaign manager, died in February 1904, there was no one in the Republican Party to oppose Roosevelt and he easily won the nomination.  When an effort to draft former president Grover Cleveland failed, the Democrats were without a candidate and finally settled on obscure New York judge Alton B. Parker.  The outcome was never in doubt.  Roosevelt crushed Parker 56%-38% in the popular vote and 336-140 in the Electoral College, sweeping the country outside the perennially Democratic Solid South.  Socialist Eugene Debs got 3%.  The night of the election, after his victory was clear, Roosevelt promised not to run again in 1908.  He later regretted that promise, as it compelled him to leave the White House at the age of only fifty, at the height of his popularity.", 'id': 2932}
---
{'passage': 'At the Whig national convention in 1848, the nomination of Gen. Zachary Taylor for president angered the supporters of Henry Clay as well as the opponents of slavery extension into the territory gained by the U.S.-Mexican War. A group of practical Whig politicians nominated Fillmore for vice president, believing that he would heal party wounds and help the ticket carry New York state.', 'id': 156}
---
{'passage': "After leaving Congress, Fillmore was the unsuccessful Whig candidate for Governor of New York in 1844. He served as New York State Comptroller from 1847 to 1849. As state comptroller, he revised New York's banking system, making it a model for the future National Banking System.", 'id': 155}

{'passage': 'Beetles can be found in almost all habitats, but are not known to occur in the sea or in the polar regions. They interact with their ecosystems in several ways. They often feed on plants and fungi, break down animal and plant debris, and eat other invertebrates. Some species are prey of various animals including birds and mammals. Certain species are agricultural pests, such as the Colorado potato beetle Leptinotarsa decemlineata, the boll weevil Anthonomus grandis, the red flour beetle Tribolium castaneum, and the mungbean or cowpea beetle Callosobruchus maculatus, while other species of beetles are important controls of agricultural pests. For example, coccinellidae ("ladybirds" or "ladybugs") consume aphids, scale insects, thrips, and other plant-sucking insects that damage crops.', 'id': 2378}
---
{'passage': 'Besides being abundant and varied, the Coleoptera are able to exploit the wide diversity of food sources available in their many habitats. Some are generalists, eating both plants and animals. Other beetles are highly specialised in their diet. Many species of leaf beetles, longhorn beetles, and weevils are very host specific, feeding on only a single species of plant. Ground beetles and rove beetles (family Staphylinidae), among others, are primarily carnivorous and will catch and consume many other arthropods and small prey such as earthworms and snails. While most predatory beetles are generalists, a few species have more specific prey requirements or preferences.', 'id': 2412}
---
{'passage': 'Beetles are a group of insects which have the largest number of species. They are placed in the order Coleoptera,which means "sheathed wing" and contains more described species than in any other order in the animal kingdom, constituting about twenty-five percent of all known life-forms. James K. Liebherr and Joseph V. McHugh in Resh, V. H. & R. T. CardÃ© (Editors) 2003. Encyclopedia of Insects. Academic Press.  Forty percent of all described insect species are beetles (about 350,000 species ), and new species are frequently discovered. Estimates put the total number of species, described and undescribed, at between 5 and 8 million.', 'id': 2377}
---
{'passage': '* Ground beetles (family Carabidae) are common predators of many different insects and other arthropods, including fly eggs, caterpillars, wireworms and others.', 'id': 2432}
---
{'passage': 'Beetle larvae can be differentiated from other insect larvae by their hardened, often darkened head, the presence of chewing mouthparts, and spiracles along the sides of the body. Like adult beetles, the larvae are varied in appearance, particularly between beetle families. Beetles whose larvae are somewhat flattened and are highly mobile are the ground beetles, some rove beetles, and others; their larvae are described as campodeiform. Some beetle larvae resemble hardened worms with dark head capsules and minute legs. These are elateriform larvae, and are found in the click beetle (Elateridae) and darkling beetle (Tenebrionidae) families. Some elateriform larvae of click beetles are known as wireworms. Beetles in the families of the Scarabaeoidea have short, thick larvae described as scarabaeiform, but more commonly known as grubs.', 'id': 2397}

{'passage': 'Knowing that the Confederates could no longer send reinforcements to the Vicksburg garrison, Grant turned west and won the Battle of Champion Hill. The Confederates retreated inside their fortifications at Vicksburg, and Grant promptly surrounded the city. Finding that assaults against the impregnable breastworks were futile, he settled in for a six-week siege. Cut off and with no possibility of relief, Pemberton surrendered to Grant on July 4, 1863. It was a devastating defeat for the Southern cause, effectively splitting the Confederacy in two, and, in conjunction with the Union victory at Gettysburg the previous day, is widely considered the turning point of the war. For this victory, President Lincoln promoted Grant to the rank of major general in the regular army, effective July 4.', 'id': 1793}
---
{'passage': 'After the Union victory at Gettysburg, Meade\'s failure to pursue Lee and months of inactivity for the Army of the Potomac persuaded Lincoln to bring in a western general, Ulysses S. Grant. Grant already had a solid string of victories in the Western Theater, including the battles of Vicksburg and Chattanooga. Responding to criticism of Grant, Lincoln was quoted as saying, "I cannot spare this man. He fights." Grant waged his bloody Overland Campaign in 1864 with a strategy of a war of attrition, characterized by high Union losses at battles such as the Wilderness and Cold Harbor, but by proportionately higher Confederate losses. His invasion campaign eventually bottled Lee up in the Siege of Petersburg, so that Grant could take Richmond, and bring the war to a close in the spring of 1865.', 'id': 348}
---
{'passage': 'The campaign continued, but Lee, anticipating Grant\'s move, beat him to Spotsylvania, Virginia, where, on May 8, the fighting resumed. The Battle of Spotsylvania Court House lasted 14 days. On May 11, Grant wrote a famous dispatch containing the line "I propose to fight it out along this line if it takes all summer". These words summed up his attitude about the fighting, and the next day, May 12, he ordered a massive assault by Hancock\'s 2nd Corps that broke a portion of Lee\'s line, captured 30 artillery pieces, took 4,000 prisoners, and broke forever the famous Stonewall Division. In spite of mounting Union casualties, the contest\'s dynamics changed in Grant\'s favor. Most of Lee\'s great victories in earlier years had been won on the offensive, employing surprise movements and fierce assaults. Now, he was forced to continually fight on the defensive without a chance to regroup or replenish against an opponent that was well supplied and had superior numbers. The next major battle, however, demonstrated the power of a well-prepared defense. Cold Harbor was one of Grant\'s most controversial battles, in which he launched on June 3 a massive three-corps assault without adequate reconnaissance on a well-fortified defensive line, resulting in horrific casualties (3,000 7,000 killed, wounded, and missing in the first 40 minutes, although modern estimates have determined that the total was likely less than half of the famous figure of 7,000 that has been used in books for decades; as many as 12,000 for the day, far outnumbering the Confederate losses). Grant said of the battle in his memoirs "I have always regretted that the last assault at Cold Harbor was ever made. I might say the same thing of the assault of the 22nd of May, 1863, at Vicksburg. At Cold Harbor no advantage whatever was gained to compensate for the heavy loss we sustained." But Grant moved on and kept up the pressure. He stole a march on Lee, slipping his troops across the James River.', 'id': 1803}
---
{'passage': "The Battle of the Wilderness was a stubborn, bloody two-day fight, resulting in advantage to neither side, but with heavy casualties on both. After similar battles in Virginia against Lee, all of Grant's predecessors had retreated from the field. Grant ignored the setback and ordered an advance around Lee's flank to the southeast, which lifted the morale of his army. Grant's strategy was not just to win individual battles, it was to fight constant battles in order to wear down and destroy Lee's army.", 'id': 1800}
---
{'passage': 'In early April 1862, Grant was surprised by Generals Albert Sidney Johnston and P.G.T. Beauregard at the Battle of Shiloh. The sheer violence of the Confederate attack sent the Union forces reeling. Nevertheless, Grant refused to retreat. With grim determination, he stabilized his line. Then, on the second day, with the help of timely reinforcements, Grant counterattacked and turned a serious reverse into a victory.', 'id': 1788}

