{'passage': 'Previously part of Sweden and from 1809 an autonomous Grand Duchy within the Russian Empire, Finland declared its independence in 1917. Today, Finland is a democratic, parliamentary republic and has been a member state of the United Nations since 1955 and the European Union since 1995. Finland has thriving services and manufacturing sectors and is a highly democratic welfare state with low levels of corruption, consistently ranking at or near the top in international comparisons of national performance.', 'id': 1552}
---
{'passage': "Finland currently numbers 5,290,158 inhabitants and has an average population density of 17 inhabitants per square kilometre.  This makes it, after Norway and Iceland, the most sparsely populated country in Europe. Finland's population has always been concentrated in the southern parts of the country, which is even more pronounced after twentieth-century urbanisation. The biggest and most important cities in Finland are the cities of the Greater Helsinki metropolitan area - Helsinki, Vantaa, Espoo and Kauniainen - some of the other big cities include Tampere, Turku and Oulu.", 'id': 1609}
---
{'passage': 'Today, there are over 1,200 species of vascular plant, 800 bryophytes and 1,000 lichen species in Finland, with flora being richest in the southern parts of the country. Plant life, like most of the Finnish ecology, is well adapted to tolerate the contrasting seasons and extreme weather. Many plant species, such as the Scots Pine, spruce, birch spread throughout Finland from Norway and only reached the western coast less than three millennia ago. Oak and maple grows in nature only in the southern part of Finland.', 'id': 1585}
---
{'passage': 'Finland is also a place rich in culture for history, tradition and religion. There are churches and cathedrals scattered all across Finland reflecting the strong Finnish Lutheran following. There are also museums and examples of ancient architecture remaining from the reign of the Swedish Empire over much of Finland. These sites allure thousands for their significance and historical insight. Castles from the Swedish reign are found, for example in Turku, HÃ¤meenlinna and Savonlinna. The Turku Castle is a museum. Olavinlinna in Savonlinna hosts the annual Savonlinna Opera Festival. The capital city of Helsinki, on the other hand, is famous for its Grand Duchy era architecture, which resembles that of imperial St. Petersburg.', 'id': 1674}
---
{'passage': 'The Finnish landscape is covered with thick pine forests, rolling hills and complemented with a labyrinth of lakes and inlets. Much of Finland is pristine and virgin as it contains 35 national parks from the Southern shores of the Gulf of Finland to the high fells of Lapland. It is also an urbanised region with many cultural events and activities.', 'id': 1670}

{'passage': "Administratively, Indonesia consists of 33 provinces, five of which have special status. Each province has its own political legislature and governor. The provinces are subdivided into regencies (kabupaten) and (kota), which are further subdivided into subdistricts (kecamatan), and again into village groupings (either desa or kelurahan). Following the implementation of regional autonomy measures in 2001, the regencies and cities have become the key administrative units, responsible for providing most government services. The village administration level is the most influential on a citizen's daily life, and handles matters of a village or neighborhood through an elected lurah or kepala desa (village chief).", 'id': 783}
---
{'passage': 'All provinces have unicameral, elected legislatures headed by a Premier selected in the same way as the Prime Minister of Canada. Each province also has a Lieutenant-Governor representing the Queen, analogous to the Governor General of Canada, appointed on the recommendation of the Prime Minister of Canada, though with increasing levels of consultation with provincial governments in recent years.', 'id': 2324}
---
{'passage': "Aceh, Jakarta, Yogyakarta, Papua, and West Papua provinces have greater legislative privileges and a higher degree of autonomy from the central government than the other provinces. The Acehnese government, for example, has the right to create an independent legal system; in 2003, it instituted a form of Sharia (Islamic law).    Yogyakarta was granted the status of Special Region in recognition of its pivotal role in supporting Indonesian Republicans during the Indonesian Revolution. The positions of governor and its vice governor are prioritized for descendants of the Sultan of Yogyakarta and Paku Alam, respectively, much like a sultanate. (Elucidation on the Indonesia Law No. 22/1999 Regarding Regional Governance. People's Representative Council (1999). Chapter XIV Other Provisions, Art. 122;   (translated version). The President of Republic of Indonesia (1974). Chapter VII Transitional Provisions, Art. 91  Papua, formerly known as Irian Jaya, was granted special autonomy status in 2001. As part of the autonomy package was the introduction of the Papuan People's Council tasked with arbitration and speaking on behalf of Papuan tribal customs, however, the implementation of the autonomy measures has been criticized as half-hearted and incomplete.  ;    Jakarta is the country's special capital region.", 'id': 784}
