{'passage': 'During the Second World War, Romania tried again to remain neutral, but on June 28 1940, it received a Soviet ultimatum with an implied threat of invasion in the event of non-compliance.   Soviet Ultimata and Replies of the Romanian Government in Ioan Scurtu, Theodora StÄ\x83nescu-Stanciu, Georgiana Margareta Scurtu, Istoria RomÃ¢nilor Ã®ntre anii 1918-1940 (in Romanian), University of Bucharest, 2002  Under pressure from Moscow and Berlin, the Romanian administration and the army were forced to retreat from Bessarabia as well from Northern Bukovina to avoid war.       This, in combination with other factors, prompted the government to join the Axis. Thereafter, southern Dobruja was awarded to Bulgaria, while Hungary received Northern Transylvania as result of an Axis arbitration.  The authoritarian King Carol II abdicated in 1940, succeeded by the National Legionary State, in which power was shared by Ion Antonescu and the Iron Guard. Within months, Antonescu had crushed the Iron Guard, and the subsequent year Romania entered the war on the side of the Axis powers. During the war, Romania was by the most important source of oil for Nazi Germany,    which attracted multiple bombing raids by the Allies. By means of the Axis invasion of the Soviet Union, Romania recovered Bessarabia and northern Bukovina from the Soviet Russia, under the leadership of general Ion Antonescu. The Antonescu regime played a major role in the Holocaust, Note: follow the World War II link:', 'id': 3082}
