{'passage': "Singapore's defence resources have been used in international humanitarian aid missions, including United Nations peacekeeping assignments involved in 11 different countries.    In September 2005, the Republic of Singapore Air Force (RSAF) sent three CH-47 Chinook helicopters to Louisiana to assist in relief operations for Hurricane Katrina. In the aftermath of the 2004 Asian Tsunami (or Boxing Day Tsunami}, the SAF deployed 3 tank landing ships, 12 Super Puma and 8 Chinook helicopters to aid in relief operations to the countries that were affected by the tsunami.", 'id': 2757}

{'passage': 'Indonesia is a republic with a presidential system. As a unitary state, power is concentrated in the national government. Following the resignation of President Suharto in 1998, Indonesian political and governmental structures have undergone major reforms. Four amendments to the 1945 Constitution of Indonesia In 1999, 2000, 2001 and 2002  have revamped the executive, judicial, and legislative branches.    The president of Indonesia is the head of state, commander-in-chief of the Indonesian Armed Forces, and the director of domestic governance, policy-making, and foreign affairs. The president appoints a council of ministers, who are not required to be elected members of the legislature. The 2004 presidential election was the first in which the people directly elected the president and vice president.    The president serves a maximum of two consecutive five-year terms. _ (2002), The fourth Amendment of 1945 Indonesia Constitution, Chapter III â\x80\x93 The Executive Power, Art. 7.', 'id': 774}
---
{'passage': "The Republic of Indonesia ( ) ( ), is a nation in Southeast Asia. Comprising 17,508 islands, it is the world's largest archipelagic state. With a population of over 234 million people, it is the world's fourth most populous country and the most populous Muslim-majority nation, although officially it is not an Islamic state. Indonesia is a republic, with an elected parliament and president. The nation's capital city is Jakarta. The country shares land borders with Papua New Guinea, East Timor and Malaysia. Other neighboring countries include Singapore, the Philippines, Australia, and the Indian territory of the Andaman and Nicobar Islands.", 'id': 751}
---
{'passage': "Aceh, Jakarta, Yogyakarta, Papua, and West Papua provinces have greater legislative privileges and a higher degree of autonomy from the central government than the other provinces. The Acehnese government, for example, has the right to create an independent legal system; in 2003, it instituted a form of Sharia (Islamic law).    Yogyakarta was granted the status of Special Region in recognition of its pivotal role in supporting Indonesian Republicans during the Indonesian Revolution. The positions of governor and its vice governor are prioritized for descendants of the Sultan of Yogyakarta and Paku Alam, respectively, much like a sultanate. (Elucidation on the Indonesia Law No. 22/1999 Regarding Regional Governance. People's Representative Council (1999). Chapter XIV Other Provisions, Art. 122;   (translated version). The President of Republic of Indonesia (1974). Chapter VII Transitional Provisions, Art. 91  Papua, formerly known as Irian Jaya, was granted special autonomy status in 2001. As part of the autonomy package was the introduction of the Papuan People's Council tasked with arbitration and speaking on behalf of Papuan tribal customs, however, the implementation of the autonomy measures has been criticized as half-hearted and incomplete.  ;    Jakarta is the country's special capital region.", 'id': 784}
---
{'passage': 'In contrast to Sukarno\'s antipathy to western powers and hostility to Malaysia, Indonesia\'s foreign relations approach since the Suharto "New Order" has been one of international cooperation and accommodation, to gain external support for Indonesia\'s political stability and economic development.    Indonesia maintains close relationships with its neighbors in Asia, and is a founding member of ASEAN and the East Asia Summit.    The nation restored relations with the People\'s Republic of China in 1990 following a freeze in place since anti-communist purges early in the Suharto era.  Indonesia has been a member of the United Nations since 1950, Indonesia temporarily withdrew from the UN on January 20 1965 in response to the fact that Malaysia was elected as a non-permanent member of the Security Council. It announced its intention to "resume full cooperation with the United Nations and to resume participation in its activities" on September 19 1966, and was invited to re-join the UN on September 28 1966.  and was a founder of the Non-Aligned Movement (NAM) and the Organization of the Islamic Conference (OIC).  Indonesia is signatory to the ASEAN Free Trade Area agreement, and a member of OPEC, the Cairns Group and the WTO. Indonesia has received humanitarian and development aid since 1966, in particular from the United States, western Europe, Australia, and Japan.', 'id': 778}
---
{'passage': "Administratively, Indonesia consists of 33 provinces, five of which have special status. Each province has its own political legislature and governor. The provinces are subdivided into regencies (kabupaten) and (kota), which are further subdivided into subdistricts (kecamatan), and again into village groupings (either desa or kelurahan). Following the implementation of regional autonomy measures in 2001, the regencies and cities have become the key administrative units, responsible for providing most government services. The village administration level is the most influential on a citizen's daily life, and handles matters of a village or neighborhood through an elected lurah or kepala desa (village chief).", 'id': 783}

{'passage': "Another issue that presented itself during Fillmore's presidency was the arrival of Louis Kossuth (exiled leader of a failed Hungarian revolution). Kossuth wanted the United States to abandon its non-intervention policies when it came to European affairs and recognize Hungaryâ\x80\x99s independence. The problem came with the enormous support Kossuth received from German-American immigrants to the United States (who were essential in the re-election of both Whigs and Democrats). Fillmore refused to change American policy, and decided to remain neutral despite the political implications that neutrality would produce.", 'id': 174}
---
{'passage': "Millard Fillmore (January 7, 1800   March 8, 1874) was the thirteenth President of the United States, serving from 1850 until 1853, and the last member of the Whig Party to hold that office. He was the second Vice President to assume the Presidency upon the death of a sitting President, succeeding Zachary Taylor who died of acute gastroenteritis. Fillmore was never elected President; after serving out Taylor's term, he failed to gain the nomination for the Presidency of the Whigs in the 1852 presidential election, and, four years later, in the 1856 presidential election, he again failed to win election as President as the Know Nothing Party and Whig candidate.", 'id': 148}
---
{'passage': 'Some northern Whigs remained irreconcilable, refusing to forgive Fillmore for having signed the Fugitive Slave Act. They helped deprive him of the Presidential nomination in 1852. Within a few years it was apparent that although the Compromise had been intended to settle the slavery controversy, it served rather as an uneasy sectional truce.', 'id': 177}
---
{'passage': 'Taylor and Fillmore disagreed on the slavery issue in the new western territories taken from Mexico in the Mexican-American War. Taylor wanted the new states to be free states, while Fillmore supported slavery in those states as a means of appeasing the South. In his own words: "God knows that I detest slavery, but it is an existing evil ... and we must endure it and give it such protection as is guaranteed by the Constitution."', 'id': 159}
---
{'passage': 'As president, Fillmore dealt with increasing party divisions within the Whig party; party harmony became one of his primary objectives. He tried to unite the party by pointing out the differences between the Whigs and the Democrats (by proposing tariff reforms that negatively reflected on the Democratic Party). Another primary objective of Fillmore was to preserve the Union from the intensifying slavery debate.', 'id': 162}

{'passage': "* The phrase 'elephants never forget' has no metaphorical meaning, it refers literally to elephants supposedly having an excellent memory.", 'id': 1287}
---
{'passage': 'Elephants are symbols of wisdom in Asian cultures, and are famed for their memory and high intelligence, and are thought to be on par with cetaceans    and hominids   . Aristotle once said the elephant was "the beast which passeth all others in wit and mind."', 'id': 1178}
---
{'passage': 'The word "elephant" has its origins in the Greek á¼\x90Î»Î\xadÏ\x86Î±Ï\x82, meaning "ivory" or "elephant".', 'id': 1176}
---
{'passage': 'Elephants have been working animals used in various capacities by humans. Seals found in the Indus Valley suggest that the elephant was first domesticated in ancient India. However, elephants have never been truly domesticated: the male elephant in his periodic condition of musth is dangerous and difficult to control. Therefore elephants used by humans have typically been female, war elephants being an exception, however: as female elephants in battle will run from a male, only males could be used in war. It is generally more economical to capture wild young elephants and tame them than breeding them in captivity (see also elephant "crushing").', 'id': 1276}
---
{'passage': '*The elephant, and the white elephant (also a religious symbol of Buddha) in particular, has often been used as a symbol of royal power and prestige in Asia; occurring on the flag of the kingdom Laos (three visible, supporting an umbrella, another symbol of royal power) till it became a republic in 1975, and other Indochinese and Thai realms had also displayed one or more white elephants.', 'id': 1309}

{'passage': 'The Presidentâ\x80\x99s parents, father Spence Monroe (ca. 1727 1774), a woodworker and tobacco farmer, and mother Elizabeth Jones Monroe had significant land holdings but little money. Like his parents, he was a slaveholder. Born in Westmoreland County, Virginia, Monroe went to school at Campbelltown Academy and then the College of William and Mary, both in Virginia.  After graduating from William and Mary in 1776, Monroe fought in the Continental Army, serving with distinction at the Battle of Trenton, where he was shot in his left shoulder. He is depicted holding the flag in the famous painting of Washington Crossing the Delaware. Following his military service, he practiced law in Fredericksburg, Virginia. James Monroe married Elizabeth Kortright on February 16, 1786 at the Trinity Church in New York.', 'id': 2507}
---
{'passage': "Monroe had racked up many debts during his years of public life. As a result, he was forced to sell off his Highland Plantation (now called Ash Lawn-Highland; it is owned by his alma mater, the College of William and Mary, which has opened it to the public). Throughout his life, he was not financially solvent, and his wife's poor health made matters worse.  For these reasons, he and his wife lived in Oak Hill until Elizabeth's death on September 23, 1830.", 'id': 2521}
---
{'passage': "When his presidency expired on March 4, 1825, James Monroe lived at Monroe Hill on the grounds of the University of Virginia.  This university's modern campus was Monroe's family farm from 1788 to 1817, but he had sold it in the first year of his presidency to the new college.  He served on the college's Board of Visitors under Jefferson and then under the second rector and another former President James Madison, until his death.", 'id': 2520}
---
{'passage': 'James Monroe (April 28, 1758 â\x80\x93 July 4, 1831) was the fifth President of the United States (1817-1825). His administration was marked by the acquisition of Florida (1819); the Missouri Compromise (1820), in which Missouri was declared a slave state; and the profession of the Monroe Doctrine (1823), declaring U.S. opposition to European interference in the Americas.', 'id': 2506}
---
{'passage': 'Monroe was elected to the Virginia House of Delegates in 1782 and served in the Continental Congress from 1783 to 1786. As a youthful politician, he joined the anti-Federalists in the Virginia Convention which ratified the Constitution, and in 1790, was elected United States Senator.', 'id': 2508}

{'passage': "After Cleveland began his second term in 1893, Doctor R.M. O'Reilly found an ulcerated sore a little less than one inch (24 mm) in diameter on the left lingual surface of Cleveland's hard palate. Initial biopsies were inconclusive; later the samples were proven to be a malignant cancer. Because of the financial depression of the country, Cleveland decided to have surgery performed on the tumor in secrecy to avoid further market panic. The surgery occurred on July 1, to give Cleveland time to make a full recovery in time for an August 7 address to Congress, which had recessed at the end of June.", 'id': 518}
---
{'passage': "Under the guise of a vacation cruise, Cleveland, accompanied by lead surgeon Dr. Joseph Bryant, left for New York. Bryant, joined by his assistants Dr. John F. Erdmann, Dr. W.W. Keen Jr., Dr. Ferdinand Hasbrouck (dentist and anesthesiologist), and Dr. Edward Janeway, operated aboard E. C. Benedict's yacht Oneida as it sailed off Long Island. The surgery was conducted through the President's mouth, to avoid any scars or other signs of surgery. The team, sedating Cleveland with nitrous oxide (laughing gas), removed his upper left jaw and portions of his hard palate. The size of the tumor and the extent of the operation left Cleveland's mouth severely disfigured. During another surgery, an orthodontist fitted Cleveland with a hard rubber prosthesis that corrected his speech and covered up the surgery.", 'id': 519}
---
{'passage': "A cover story about the removal of two bad teeth kept the suspicious press somewhat placated. Even when a newspaper story appeared giving details of the actual operation, the participating surgeons discounted the severity of what transpired during Cleveland's vacation. In 1917, one of the surgeons present on the Oneida (Dr. W.W. Keen, Jr.) wrote an article detailing the operation. The lump was preserved and is on display at the MÃ¼tter Museum in Philadelphia, Pennsylvania.  The final diagnosis was verrucous carcinoma and the president was cured by the surgical excision.", 'id': 520}
---
{'passage': "After leaving the White House, Cleveland lived in retirement at his estate, Westland Mansion, in Princeton, New Jersey. For a time he was a trustee of Princeton University, bringing him into opposition to the school's president, Woodrow Wilson. Conservative Democrats hoped to nominate him for another presidential term in 1904, but his age and health forced them to turn to other candidates. Cleveland consulted occasionally with President Theodore Roosevelt, with whom he had constructively worked while Governor of New York decades before.", 'id': 522}
---
{'passage': "Some of Cleveland's actions were controversial with political factions. Such criticisms include but are not limited to: his intervention in the Pullman Strike of 1894 in order to keep the railroads moving (a move which angered labor unions), his support of the gold standard, and opposition to free silver which alienated the agrarian wing of the Democrats.  Furthermore, critics complained that he had little imagination and seemed overwhelmed by the nation's economic disasters   depressions and strikes   in his second term. He lost control of his party to the agrarians and silverites in 1896.", 'id': 474}

{'passage': 'The treaties signed in 1947 and 1948 with the Soviet Union included Finnish obligations, restraints, and reparations as well as further Finnish territorial concessions (cf. the Moscow Peace Treaty of 1940). Finland ceded most of Finnish Karelia, Salla, and Pechenga, which amounted to ten percent of its land area and twenty percent of its industrial capacity. Some 400,000 evacuees, mainly women and children, fled these areas. Establishing trade with the Western powers, such as Great Britain, and the reparations to the Soviet Union caused Finland to transform itself from a primarily agrarian economy to an industrialised one. Even after the reparations had been paid off, Finland continued to trade with the Soviet Union in the framework of bilateral trade.', 'id': 1573}
---
{'passage': 'After the collapse of the Soviet Union in 1991, Finland freed itself from the last restrictions imposed on it by the Paris peace treaties of 1947. The Finno-Soviet Agreement of Friendship, Cooperation, and Mutual Assistance (and the restrictions included therein) was annulled but Finland recognised the Russian Federation as the successor of the USSR and was quick to draft bilateral treaties of goodwill as well as reallocating Soviet debts.', 'id': 1639}
---
{'passage': 'In 1947, King Michael I was forced by the Communists to abdicate and leave the country, Romania was proclaimed a republic , and remained under direct military and economic control of the USSR until the late 1950s. During this period, Romania\'s resources were drained by the "SovRom" agreements: mixed Soviet-Romanian companies established to mask the looting of Romania by the Soviet Union.', 'id': 3086}
---
