{'passage': 'Faraday worked extensively in the field of chemistry, discovering chemical substances such as benzene (which he called bicarburet of hydrogen), inventing the system of oxidation numbers, and liquefying gases such as chlorine. In 1820 Faraday reported on the first syntheses of compounds made from carbon and chlorine, C 2 H 6  and C 2 H 4 , and published his results the following year.          Faraday also determined the composition of the chlorine clathrate hydrate, which had been discovered by Humphry Davy in 1810.', 'id': 90}
---
{'passage': 'The battery made by Volta is credited to have been the first cell. It consists of two electrodes: one made of zinc, the other of copper. The electrolyte is sulphuric acid. The electrolyte exists in the form 2H +  and SO 4   2- .  The zinc, which is higher than both copper and hydrogen in the electrochemical series, reacts with the negatively charged sulphate. ( SO 4  ) The positively charged hydrogen bubbles start depositing around the copper and take away some of its electrons. This makes the zinc rod the negative electrode and the copper rod the positive electrode.', 'id': 2258}
---
