{'passage': 'Most of the energy is produced from fossil fuels, mainly coal and oil. Fossil fuels are, however, all imported, because Finland doesn\'t have any fossil fuel sources, unlike neighboring Norway with oil and Estonia with oil shale. Nevertheless, Finland fares exceptionally well with renewable energy: 25 percent of energy is renewable, which is high compared to the EU average 10 percent. About one fifth of all the energy consumed in Finland is wood-based. This is not a remnant of old ages: the pulp and paper industry   Finland\'s third-largest industry   burns its byproducts, such as black liquor residues and waste wood chippings, resulting in net production of energy. Many homeowners also own renewed forests, and use wood as an additional (but not primary) heat source. About seven percent of electricity is produced from peat harvested from Finland\'s extensive bogs. Peat is "bioenergy", but there is no consensus whether it is renewable (carbon neutral) or not.', 'id': 1652}

{'passage': 'Canada is a federation composed of ten provinces and three territories; in turn, these may be grouped into numerous regions. Western Canada consists of British Columbia and three Prairie provinces (Alberta, Saskatchewan, Manitoba). Eastern Canada consists of Central Canada (Quebec and Ontario) and Atlantic Canada (comprised of the three Maritime provinces of New Brunswick, Prince Edward Island, and Nova Scotia; and Newfoundland and Labrador).  Three territories (Yukon, Northwest Territories, and Nunavut) comprise Northern Canada. Provinces have a large degree of autonomy from the federal government,  territories somewhat less. Each has its own provincial or territorial symbols.', 'id': 2322}
---
{'passage': "Administratively, Indonesia consists of 33 provinces, five of which have special status. Each province has its own political legislature and governor. The provinces are subdivided into regencies (kabupaten) and (kota), which are further subdivided into subdistricts (kecamatan), and again into village groupings (either desa or kelurahan). Following the implementation of regional autonomy measures in 2001, the regencies and cities have become the key administrative units, responsible for providing most government services. The village administration level is the most influential on a citizen's daily life, and handles matters of a village or neighborhood through an elected lurah or kepala desa (village chief).", 'id': 783}
---
{'passage': "Quebec underwent profound social and economic changes during the Quiet Revolution of the 1960s. QuÃ©bÃ©cois nationalists began pressing for greater provincial autonomy. The separatist Parti QuÃ©bÃ©cois first came to power in 1976. A referendum on sovereignty-association in 1980 was rejected by a solid majority of the population, and a second referendum in 1995 was rejected by a slimmer margin of just 50.6% to 49.4%.    In 1997, the Canadian Supreme Court ruled unilateral secession by a province to be unconstitutional; Quebec's sovereignty movement has continued nonetheless.", 'id': 2295}
---
{'passage': 'In 1867, with the union of three British North American colonies through Confederation, Canada was formed as a federal, semi-autonomous polity.           This began an accretion of additional provinces and territories and a process of increasing autonomy from the United Kingdom, highlighted by the Statute of Westminster in 1931 and culminating in the Canada Act in 1982 which severed the vestiges of legal dependence on the British parliament.', 'id': 2273}
---
