{'passage': "Millard Fillmore (January 7, 1800   March 8, 1874) was the thirteenth President of the United States, serving from 1850 until 1853, and the last member of the Whig Party to hold that office. He was the second Vice President to assume the Presidency upon the death of a sitting President, succeeding Zachary Taylor who died of acute gastroenteritis. Fillmore was never elected President; after serving out Taylor's term, he failed to gain the nomination for the Presidency of the Whigs in the 1852 presidential election, and, four years later, in the 1856 presidential election, he again failed to win election as President as the Know Nothing Party and Whig candidate.", 'id': 148}
---
{'passage': "Fillmore was descended from Scottish Presbyterians on his father's side and English dissenters on his mother's. He was first apprenticed to a fuller to learn the cloth-making trade. He also served as a home guard in the New York militia for some time. He struggled to obtain an education under frontier conditions, attending New Hope Academy for six months.", 'id': 150}
---
{'passage': 'At the Whig national convention in 1848, the nomination of Gen. Zachary Taylor for president angered the supporters of Henry Clay as well as the opponents of slavery extension into the territory gained by the U.S.-Mexican War. A group of practical Whig politicians nominated Fillmore for vice president, believing that he would heal party wounds and help the ticket carry New York state.', 'id': 156}

{'passage': 'Kangaroos have large, powerful hind legs, large feet adapted for leaping, a long muscular tail for balance, and a small head. Like all marsupials, female kangaroos have a pouch called a marsupium in which joeys complete postnatal development.', 'id': 1737}
---
{'passage': 'Hindleg of a kangaroo Kangaroos and wallabies have large, stretchy  tendons in their hind legs. They store elastic strain energy in the tendons of their large hind legs, providing most of the energy required for each hop by the spring action of the tendons rather than by any muscular effort. This is true in all animal species which have muscles connected to their skeleton through elastic elements such as tendons, but the effect is more pronounced in kangaroos.', 'id': 1751}
---
{'passage': "A kangaroo is a marsupial from the family Macropodidae (macropods, meaning 'large foot'). In common use the term is used to describe the largest species from this family, the Red Kangaroo, the Antilopine Kangaroo, and the Eastern and Western Grey Kangaroo of the Macropus genus. The family also includes many smaller species which include the wallabies, tree-kangaroos, wallaroos, pademelons and the Quokka, some 63 living species in all.  Kangaroos are endemic to the continent of Australia, while the smaller macropods are found in Australia and New Guinea.", 'id': 1722}
---
{'passage': 'Along with dingos and other canids, introduced species like foxes and feral cats also pose a threat to kangaroo populations. Kangaroos and wallabies are adept swimmers, and often flee into waterways if presented with the option. If pursued into the water, a large kangaroo may use its forepaws to hold the predator underwater so as to drown it.  Canadian Museum of Nature - Kangaroo URL accessed January 6, 2007.  Another defensive tactic described by witnesses is catching the attacking dog  with the forepaws and disembowelling it with the hind legs.', 'id': 1746}
---
{'passage': "Europeans have long regarded Kangaroos as strange animals. Early explorers described them as creatures that had heads like deer (without antlers), stood upright like men, and hopped like frogs.  Combined with the two-headed appearance of a mother kangaroo, this led many back home to dismiss them as travellers' tales for quite some time.", 'id': 1736}

{'passage': 'Researchers have recently discovered a turtleâ\x80\x99s organs do not gradually break down or become less efficient over time, unlike most other animals. It was found that the liver, lungs and kidneys of a centenarian turtle are virtually indistinguishable from those of its immature counterpart. This has inspired genetic researchers to begin examining the turtle genome for longevity genes.  All but Ageless, Turtles Face Their Biggest Threat: Humans', 'id': 2690}
---
{'passage': '* Pritchard, Pether C H (1979). Encyclopedia of Turtles. T.F.H. Publications.', 'id': 2696}
---
{'passage': 'Turtles are reptilians of the Order Testudines (all living turtles belong to the crown group Chelonia), most of whose body is shielded by a special bony or cartilaginous shell developed from their ribs. The Order Testudines includes both extant (living) and extinct species, the earliest known turtles being from around 215 million years ago,  /ref> making turtles one of the oldest reptile groups, and a much more ancient group than lizards and snakes.  About 300 species are alive today; some are highly endangered.', 'id': 2683}
---
{'passage': 'Turtles can take many years to reach breeding age. Often turtles only breed every few years or more.', 'id': 2689}
---
{'passage': 'Even though many turtles spend large amounts of their lives underwater, all turtles and tortoises breathe air, and must surface at regular intervals to refill their lungs. They can also spend much of their lives on dry land. Aquatic respiration in Australian freshwater turtles is currently being studied. Some species have large cloacal cavities that are lined with many finger-like projections. These projections, called "papillae", have a rich blood supply, and serve to increase the surface area of the cloaca. The turtles can take up dissolved oxygen from the water using these papillae, in much the same way that fish use gills to respire.', 'id': 2686}

{'passage': 'During World War II, the Imperial Japanese Army invaded Malaya, culminating in the Battle of Singapore. The ill-prepared British were defeated in six days, and surrendered the supposedly impregnable "Bastion of the Empire" to General Tomoyuki Yamashita on 15 February 1942 in what is now known as the British Empire\'s greatest military defeat. The Japanese renamed Singapore  , from Japanese  , or "southern island obtained in the age of ShÅ\x8dwa", and occupied it until the British repossessed the island on September 12 1945, a month after the Japanese surrender.', 'id': 2712}
---
{'passage': 'The British East India Company established a trading post on the island in 1819. The main settlement up to that point was a Malay fishing village at the mouth of the Singapore River. Several hundred indigenous Orang Laut people also lived around the coast, rivers and smaller islands. The British used Singapore as a strategic trading post along the spice route.    It became one of the most important commercial and military centres of the British Empire. Winston Churchill called it "Britain\'s greatest defeat" when it was occupied by the Japanese during World War II.    Singapore reverted to British rule in 1945. In 1963, it merged with Malaya, Sabah and Sarawak to form Malaysia. Less than two years later it split from the federation and became an independent republic on 9 August 1965. Singapore was admitted to the United Nations on September 21 that same year.', 'id': 2701}
---
{'passage': "Singapore became a self-governing state in 1959 with Yusof bin Ishak its first Yang di-Pertuan Negara and Lee Kuan Yew its first Prime Minister. Following the 1962 Merger Referendum of Singapore, Singapore joined Malaya, along with Sabah and Sarawak, to form the Federation of Malaysia on September 16 1963, but separated from it two years later after heated ideological conflict between the state's PAP government and the federal Kuala Lumpur government. Singapore officially gained sovereignty on 9 August 1965.    Yusof bin Ishak was sworn in as the first President of Singapore and Lee Kuan Yew remained prime minister.", 'id': 2714}
---
{'passage': "For most of the colonial period, Dutch control over these territories was tenuous; only in the early 20th century did Dutch dominance extend to what was to become Indonesia's current boundaries. Dutch troops were constantly engaged in quelling rebellions both on and off Java. The influence of local leaders such as Prince Diponegoro in central Java, Imam Bonjol in central Sumatra and Pattimura in Maluku, and a bloody thirty-year war in Aceh weakened the Dutch and tied up the colonial military forces.(Schwartz 1999, pages 3â\x80\x934) Despite major internal political, social and sectarian divisions during the National Revolution, Indonesians, on the whole, found unity in their fight for independence.  The Japanese invasion and subsequent occupation during WWII ended Dutch rule,  ;    and encouraged the previously suppressed Indonesian independence movement. Two days after the surrender of Japan in August 1945, Sukarno, an influential nationalist leader, declared independence and was appointed president.  ;  ;  ; Reid (1973), page 30  The Netherlands tried to reestablish their rule, and a bitter armed and diplomatic struggle ended in December 1949, when in the face of international pressure, the Dutch formally recognized Indonesian independence.  ;", 'id': 767}
---
{'passage': "The first records of settlement in Singapore are from the second century AD.    The island was an outpost of the Sumatran Srivijaya empire and originally bore the Javanese name Temasek ('sea town'). Temasek (Tumasek) rapidly became a significant trading settlement, but declined in the late 14th century. There are few remnants of old Temasek in Singapore, but archaeologists in Singapore have uncovered artefacts of that and other settlements. Between the 16th and early 19th centuries, Singapore island was part of the Sultanate of Johor. During the Malay-Portugal wars in 1613, the settlement was set ablaze by Portuguese troops.    The Portuguese subsequently held control in that century and the Dutch in the 17th, but throughout most of this time the island's population consisted mainly of fishermen.", 'id': 2708}

{'passage': 'Beetle larvae can be differentiated from other insect larvae by their hardened, often darkened head, the presence of chewing mouthparts, and spiracles along the sides of the body. Like adult beetles, the larvae are varied in appearance, particularly between beetle families. Beetles whose larvae are somewhat flattened and are highly mobile are the ground beetles, some rove beetles, and others; their larvae are described as campodeiform. Some beetle larvae resemble hardened worms with dark head capsules and minute legs. These are elateriform larvae, and are found in the click beetle (Elateridae) and darkling beetle (Tenebrionidae) families. Some elateriform larvae of click beetles are known as wireworms. Beetles in the families of the Scarabaeoidea have short, thick larvae described as scarabaeiform, but more commonly known as grubs.', 'id': 2397}
---
{'passage': 'All beetle larvae go through several instars, which are the developmental stages between each moult. In many species the larvae simply increase in size with each successive instar as more food is consumed. In some cases, however, more dramatic changes occur. Among certain beetle families or genera, particularly those that exhibit parasitic lifestyles, the first instar (the planidium) is highly mobile in order to search out a host, while the following instars are more sedentary and remain on or within their host. This is known as hypermetamorphosis; examples include the blister beetles (family Meloidae) and some rove beetles, particularly those of the genus Aleochara.', 'id': 2398}
---
{'passage': 'The larva is usually the principal feeding stage of the beetle life cycle. Larvae tend to feed voraciously once they emerge from their eggs. Some feed externally on plants, such as those of certain leaf beetles, while others feed within their food sources. Examples of internal feeders are most Buprestidae and longhorn beetles. The larvae of many beetle families are predatory like the adults (ground beetles, ladybirds, rove beetles). The larval period varies between species but can be as long as several years.', 'id': 2396}
---
{'passage': 'Beetles and their larvae have a variety of strategies to avoid being attacked by predators or parasitoids. These include camouflage, mimicry, toxicity, and active defence.', 'id': 2407}
---
{'passage': 'As with all endopterygotes, beetle larvae pupate, and from this pupa emerges a fully formed, sexually mature adult beetle, or imago. Adults have an extremely variable lifespan, from weeks to years, depending on the species.', 'id': 2399}

{'passage': 'Different animals are called turtles, tortoises, or terrapins in different varieties of English', 'id': 2692}
---
{'passage': 'Several species of dung beetle, most notably Scarabaeus sacer (often referred to as "scarab"), enjoyed a sacred status among the ancient Egyptians, as the creatures were likened to the major god Khepri. Some scholars suggest that the Egyptians\' practice of making mummies was inspired by the brooding process of the beetle. Many thousands of amulets and stamp seals have been excavated that depict the scarab. In many artifacts, the scarab is depicted pushing the sun along its course in the sky, much as scarabs push or roll balls of dung to their brood sites. During and following the New Kingdom, scarab amulets were often placed over the heart of the mummified deceased.', 'id': 2437}
---
{'passage': 'In Scotland, during the reign of James VI, wolves were considered such a threat to travellers that special houses called "spittals" were erected on the highways for protection.    The people of the Scottish Highlands used to bury their dead on offshore islands to avoid having the bodies eaten by wolves.    In Imperial Russia 1890, a document was produced stating that 161 people had been killed by wolves in 1871.  During the First World War, starving wolves had amassed in great numbers in Kovno and began attacking Imperial Russian and Imperial German fighting forces, causing the two fighting armies to form a temporary truce to fight off the animals.  /ref>', 'id': 1143}
---
{'passage': 'Leopards were kept in a menagerie established by King John at the Tower of London in the 13th century; around 1235 three animals were given to Henry III by the Holy Roman Emperor Frederick II.', 'id': 2489}
---
{'passage': 'In Altaic mythology of the Central Asian   Turkic and Mongolian peoples, the wolf is a revered animal. The shamanic Turkic peoples even believed they were descendants of wolves in Turkic legends. The legend of Asena is an old Turkic myth that tells of how the Turkic people were created. In Northern China a small Turkic village was raided by Chinese soldiers, but one small baby was left behind. An old she-wolf with a sky-blue mane named Asena found the baby and nursed him, then the she-wolf gave birth to half wolf, half human cubs therefore the Turkic people were born. Also in Turkic mythology it is believed that a gray wolf showed the Turks the way out of their legendary homeland Ergenekon, which allowed them to spread and conquer their neighbours.  Cultural Life â\x80\x93 Literature Turkey Interactive CD-ROM. Retrieved on August 11, 2007.   T.C. Kultur Bakanligi.  Nevruz Celebrations in Turkey and Central Asia. Ministry of Culture, Republic of Turkey. Retrieved on August 11, 2007,  The genesis story of the Turks and Mongols is paralleled in the Roman myth of Romulus and Remus, the traditional founders of Rome. The twin babies were ordered to be killed by their great uncle Amulius, though the servant ordered to kill them however, relented and placed the two on the banks of the Tiber river. The river, which was in flood, rose and gently carried the cradle and the twins downstream, where under the protection of the river deity Tiberinus, they would be adopted by a she-wolf known as Lupa in Latin, an animal sacred to Mars.', 'id': 1112}

{'passage': "The species' success owes in part to its opportunistic hunting behaviour and its adaptability to a variety of habitats. The leopard consumes virtually any animal it can catch and ranges from rainforest to desert. Its ecological role resembles that of the similarly-sized cougar in the Americas. Physically, the spotted cat most closely resembles the jaguar, although it is of lighter build.", 'id': 2447}
---
{'passage': "The cougar is another predator encountered by the gray wolf in North America. As with the coyote, the gray wolf is usually hostile toward the big cats and will kill cougar kittens if given the opportunity. The wolf's relation to adult cougars is more complex. A pack often takes advantage of cougars, stealing kills and sometimes killing mature adults. Interactions between solitary wolves and cougars are rarer, but the two species have killed each other.    National Park Service cougar specialist Kerry Murphy stated that the cougar usually is at an advantage on a one to one basis, considering it can effectively use its claws, as well as its teeth, unlike the wolf which relies solely on its teeth. Yellowstone officials have reported that attacks between cougars and wolves are not uncommon. Multiple incidents of cougars taking wolves and vice versa have been recorded in Yellowstone National Park. However, researchers in Montana have found that wolves regularly kill cougars in the area, though they did not specify whether or not this was a pack situation.   ", 'id': 1102}
---
{'passage': 'The giant otter (Pteronura brasiliensis) inhabits South America, especially the Amazon river basin, but is becoming increasingly rare due to poaching, habitat loss, and the use of mercury and other toxins in illegal alluvial gold mining. This gregarious animal grows to a length of up to 1.8 metres (6 feet), and is more aquatic than most other otters.', 'id': 1931}
---
{'passage': "The polar bear (Ursus maritimus) is a bear native to the Arctic. Polar bears and Kodiak bears are the world's largest land carnivores, with most adult males weighing 300-600 kg (660-1320 lb); adult females are about half the size of males. Its fur is hollow and translucent, but usually appears as white or cream colored, thus providing the animal with effective camouflage.  Its skin is actually black in color. Its thick blubber and fur insulate it against the cold. The bear has a short tail and small ears that help reduce heat loss, as well as a relatively small head and long, tapered body to streamline it for swimming.", 'id': 2591}
---
{'passage': "One of many spotted cats, a leopard may be mistaken for a cheetah or a jaguar. The leopard has rosettes rather than cheetah's simple spots, but they lack internal spots, unlike the jaguar. The leopard is larger and less lanky than the cheetah but smaller than the jaguar. The leopard's black, irregular rosettes serve as camouflage. They are circular in East Africa but tend to be square in southern Africa.  .", 'id': 2453}

{'passage': 'On November 6, 1860, Lincoln was elected as the 16th President of the United States, beating Democrat Stephen A. Douglas, John C. Breckinridge of the Southern Democrats, and John Bell of the new Constitutional Union Party. He was the first Republican president, winning entirely on the strength of his support in the North: he was not even on the ballot in nine states in the South, and won only 2 of 996 counties in the other Southern states. Lincoln gained 1,865,908 votes (39.9% of the total), for 180 electoral votes; Douglas, 1,380,202 (29.5%) for 12 electoral votes; Breckenridge, 848,019 (18.1%) for 72 electoral votes; and Bell, 590,901 (12.5%) for 39 electoral votes. There were fusion tickets in some states, but even if his opponents had combined in every state, Lincoln had a majority vote in all but two of the states in which he won the electoral votes and would still have won the electoral college and the election.', 'id': 319}
---
{'passage': 'Abraham Lincoln (February 12, 1809 â\x80\x93 April 15, 1865) was the sixteenth President of the United States, serving from March 4, 1861 until his assassination. As an outspoken opponent of the expansion of slavery in the United States, "[I]n his short autobiography written for the 1860 presidential campaign, Lincoln would describe his protest in the Illinois legislature as one that \'briefly defined his position on the slavery question, and so far as it goes, it was then the same that it is now." This was in reference to the anti-expansion sentiments he had then expressed. Doris Kearns Goodwin, Team of Rivals: The Political Genius of Abraham Lincoln (2005) p. 91.  Holzer pg. 232.  Writing of the Cooper Union  speech, Holzer notes, "Cooper Union proved a unique confluence of political culture, rhetorical opportunity, technological innovation, and human genius, and it brought Abraham Lincoln to the center stage of American politics at precisely the right time and place, and with precisely the right message: that slavery was wrong, and ought to be confined to the areas where it already existed, and placed on the \'course of ultimate extinction... .\'"  Lincoln won the Republican Party nomination in 1860 and was elected president later that year. During his term, he helped preserve the United States by leading the defeat of the secessionist Confederate States of America in the American Civil War. He introduced measures that resulted in the abolition of slavery, issuing his Emancipation Proclamation in 1863 and promoting the passage of the Thirteenth Amendment to the Constitution in 1865.', 'id': 278}
---
{'passage': 'John Adams, Jr. (October 30,1735   July 4, 1826)  was the second President of the United States (1797 1801). He also served as America\'s first Vice President (1789 1797). He was defeated for re-election in the "Revolution of 1800" by Thomas Jefferson. Adams was also the first President to reside in the newly built White House in Washington, D.C., which was completed in 1800.', 'id': 635}
---
{'passage': "Lincoln believed in the Whig theory of the presidency, which left Congress to write the laws while he signed them, vetoing only those bills that threatened his war powers. Thus, he signed the Homestead Act in 1862, making millions of acres of government-held land in the West available for purchase at very low cost. The Morrill Land-Grant Colleges Act, also signed in 1862, provided government grants for agricultural universities in each state. The Pacific Railway Acts of 1862 and 1864 granted federal support for the construction of the United States' First Transcontinental Railroad, which was completed in 1869. Other important legislation involved economic matters, including the first income tax and higher tariffs. Also included was the creation of the system of national banks by the National Banking Acts of 1863, 1864, and 1865, which allowed the creation of a strong national financial system.  Congress created and Lincoln approved the Department of Agriculture in 1862, although that institution would not become a Cabinet-level department until 1889.", 'id': 360}
---
{'passage': 'A Whig and an admirer of party leader Henry Clay,  Lincoln was elected to a term in the U.S. House of Representatives in 1846. As a freshman House member, he was not a particularly powerful or influential figure. He spoke out against the Mexican-American War, which he attributed to President Polk\'s desire for "military glory â\x80\x94 that attractive rainbow, that rises in showers of blood." He also challenged the President\'s claims regarding the Texas boundary and offered Spot Resolutions demanding to know on what "spot" on US soil that blood was first spilt.  Congressional Globe, 30th Session (1848) pp.93-95  In January of 1848, he was among the 82 Whigs who defeated 81 Democrats in a procedural vote on an amendment to send a routine resolution back to committee with instructions to add the words "a war unnecessarily and unconstitutionally begun by the President of the United States." The amendment passed, but the bill never reemerged from committee and was never finally voted upon.  House Journal, 30th Session (1848) pp.183-184', 'id': 300}

