{'passage': 'For most of central sub-Saharan Africa, agricultural expansion marked the period before 500. Farming began earliest on the southern tips of the Sahara, eventually giving rise to village settlements. Toward the end of the classical era, larger regional kingdoms were formed in West Africa, one of which was the Kingdom of Ghana, north of what is today the nation of Ghana. After its fall at the beginning of the 13th century, Akan migrants moved southward then founded several nation-states including the first great Akan empire of the Bono which is now known as the ibalBrong Ahafo region in Ghana. Later Akan groups such as the Ashanti federation and Fante states are thought to possibly have roots in the original Bono settlement at Bono manso. Much of the area was united under the Empire of Ashanti by the 16th century. The Ashanti government operated first as a loose network and eventually as a centralized kingdom with an advanced, highly-specialized bureaucracy centered in Kumasi.', 'id': 1345}

{'passage': 'The Great Depression of 1929 brought economic hardship to all of Canada. In response, the Co-operative Commonwealth Federation (CCF) in Alberta and Saskatchewan presaged a welfare state as pioneered by Tommy Douglas in the 1940s and 1950s. Canada declared war on Germany independently during World War II under Liberal Prime Minister William Lyon Mackenzie King, three days after Britain. The first Canadian Army units arrived in Britain in December 1939.    Canadian troops played important roles in the Battle of the Atlantic, the failed 1942 Dieppe Raid in France, the Allied invasion of Italy, and the Battle of the Scheldt during the liberation of the Netherlands in 1944. The Canadian economy boomed as industry manufactured military materiel  for Canada, Britain, China and the Soviet Union. Despite another Conscription Crisis in Quebec, Canada finished the war with one of the largest armed forces in the world.', 'id': 2293}
---
{'passage': '      Canada joined the United Nations in 1945 and became a founding member of NATO in 1949. During the Cold War, Canada was a major contributor to UN forces in the Korean War, and founded the North American Aerospace Defense Command (NORAD) in cooperation with the United States to defend against aerial attacks from the Soviet Union.', 'id': 2314}
---
{'passage': "Canada automatically entered the First World War in 1914 with Britain's declaration of war, sending volunteers to the Western Front. The Conscription Crisis of 1917  erupted when conservative Prime Minister Robert Borden brought in compulsory military service over the objection of French-speaking Quebecers.  In 1919, Canada joined the League of Nations independently of Britain; in 1931 the Statute of Westminster affirmed Canada's independence.", 'id': 2292}
