{'passage': "Canada and the United States share the world's longest undefended border, co-operate on military campaigns and exercises, and are each other's largest trading partners. Canada has nevertheless maintained an independent foreign policy, most notably maintaining full relations with Cuba and declining participation in the Iraq War. Canada also maintains historic ties to the United Kingdom and France and to other former British and French colonies through Canada's membership in the Commonwealth of Nations and La Francophonie (French-Speaking Countries).", 'id': 2310}

